go
update product_category set product_category_name = rtrim(replace(product_category_name, '	', ''))
go
update product_category set product_category_parent_id = product_category_id where right(product_category_code, 4) = '0000'
go

set nocount on

declare	
 	 @product_category_code nvarchar(240),
	 @product_category_id uniqueidentifier,
	 @product_category_parent_id uniqueidentifier
declare
	 @last_first_level_product_category_parent_id uniqueidentifier,
	 @last_second_level_product_category_parent_id uniqueidentifier,
	 @product_category_position int

declare cursor_blokk cursor fast_forward for  
select 
 		product_category_code, product_category_id
from product_category as pcn
order by pcn.product_category_code

open cursor_blokk
fetch next from cursor_blokk
 	into @product_category_code, @product_category_id

select @last_first_level_product_category_parent_id = @product_category_id
select @last_second_level_product_category_parent_id = @product_category_id

while @@fetch_status = 0 begin
	if right(@product_category_code, 2) != '00' begin
		select @product_category_position = @product_category_position+1

		update product_category set product_category_parent_id = @last_second_level_product_category_parent_id, product_category_position = @product_category_position where product_category_id = @product_category_id
	end

	if right(@product_category_code, 2) = '00' begin
		update product_category set product_category_parent_id = @last_first_level_product_category_parent_id, product_category_position = 2 where product_category_id = @product_category_id
		select @last_second_level_product_category_parent_id = @product_category_id 
		select @product_category_position = 2
	end

	if right(@product_category_code, 4) = '0000' begin
		select @last_first_level_product_category_parent_id = @product_category_id 
		update product_category set product_category_parent_id = @last_second_level_product_category_parent_id, product_category_position = 1 where product_category_id = @product_category_id
		select @product_category_position = 1
	end

	fetch next from cursor_blokk 
 		into 
			@product_category_code, @product_category_id
end   

close cursor_blokk
deallocate cursor_blokk
                            ",
